    return  (
        <div style={{margin:"auto auto",}}>
            <div>
                <label>Product Name: </label>
                <input type="text" placeholder="Product Name" />

                <label>Product Price: </label>
                <input type="number" placeholder="Product Price" />

            </div>


        </div>
    )
}

export default MyStore;
